import React from 'react';
import './App.css';
import Topbar from './Components/Topbar';
import Leftpane from './Components/Leftpane';
import Chatpane from './Components/Chatpane';
import  UserState  from './context/users/userState';
import MessageState from './context/message/currentMessageState';

function App() {
  return (
    <div className="App">
      <UserState>
        {UserStateValue => {return (
          <MessageState>
            {MessageStateValue =>{return (
              <div className="all">
                <Topbar UserStateValue={UserStateValue} />
                <div className="below-top">
                  <Leftpane UserStateValue={UserStateValue} />
                  <Chatpane
                    UserStateValue={UserStateValue}
                    MessageStateValue={MessageStateValue}
                  />
                </div>
              </div>
            )}}
          </MessageState>
        )}}
      </UserState>
    </div>
  );
}

export default App;
